
public class whilelloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
//Write a programme to print number from 1 to 10;
		int i=1;
		while(i<=10) {
			System.out.println(i);
			i++;
		}
		int j=1;
		while(j<=10) {
			System.out.println("number ="+j);
			j++;
	}
	}
	
	
}
